import styled from 'styled-components';

const DashboardContainer = styled.div`
  padding: 2rem;
  max-width: 1200px;
  margin: 0 auto;
`;

const DashboardPage = () => {
  return (
    <DashboardContainer>
      <h1>Dashboard</h1>
      <p>Welcome to your user management dashboard</p>
    </DashboardContainer>
  );
};

export default DashboardPage;
